import React from 'react';

function TopInfo() {
    return (
        <div className='top_info'>
            <img className="logo" src="../../assets/images/logo2.png" alt="Logo" />
            <span className="span">AcademicElite</span>
        </div>
    );
}

export default TopInfo;
